webpackJsonp([0xf927f8900006],{387:function(i,n){i.exports={data:{site:{siteMetadata:{title:"kujyp 개발블로그",subtitle:"ML DevOps, Python ...",menu:[{label:"Articles",path:"/"},{label:"About me",path:"/about/"}],author:{name:"kujyp",email:"swe.jaeyoungpark@gmail.com",github:"kujyp"}}},markdownRemark:{id:"/home/circleci/app/src/pages/pages/2019-01-03---about/index.md absPath of file >>> MarkdownRemark",html:'<h3>박재영</h3>\n<ul>\n<li><a href="mailto:swe.jaeyoungpark@gmail.com">swe.jaeyoungpark@gmail.com</a></li>\n<li><a href="https://github.com/kujyp">https://github.com/kujyp</a></li>\n</ul>\n<h3>Experiences</h3>\n<h4>Naver 2018.08 - 현재</h4>\n<ul>\n<li>Naver Papago MTEngine team(Machine Translation)</li>\n<li>Python, C++, DevOps</li>\n<li>Translation engine dockerize</li>\n<li>In-house tool deployment, continuous integration</li>\n</ul>\n<h4>(주) MTCOM - Researcher 2017.09 - 2018.05</h4>\n<ul>\n<li>Kotlin, Java를 활용한 B2C 안드로이드 어플리케이션 개발</li>\n<li>ReactiveX(RxJava) 개발 경험</li>\n<li>GitLab-CI, CI/CD Pipeline 구축 경험</li>\n</ul>\n<h4>스타트업 smArts - 서버, 클라이언트 개발자 2017.01 - 2017.08</h4>\n<ul>\n<li>Startup, in internet-of-things industry.</li>\n<li>Server Development(Python/django), Android Client Development.</li>\n<li>GitHub <a href="https://github.com/Jibcon/jibcon_android">https://github.com/Jibcon/jibcon_android</a></li>\n</ul>\n<h4>(주) 비시큐리티 - 솔루션 개발 2017.01 - 2017.04</h4>\n<ul>\n<li>무인 카메라로 촬영한 영상으로 생산에 위협이 되는 요소를 미리 감지하는 시스템 개발</li>\n<li>Python / OpenCV-Python 활용</li>\n<li>Demo <a href="https://www.youtube.com/watch?v=tTLDU4Gm5p4">https://www.youtube.com/watch?v=tTLDU4Gm5p4</a></li>\n</ul>\n<h3>Education</h3>\n<h4>고려대학교 2011.02 - 2018.07</h4>\n<ul>\n<li>바이오의공학부, 소프트웨어 기술과 산업 융합전공</li>\n</ul>\n<h3>Skills</h3>\n<ul>\n<li>Strong: Python, Docker, Continuous Integration, Linux(Shell scripting, Deployment)</li>\n<li>Knowledgeable: Python/tensorflow, Python/Flask, Java/Android, Kotlin/Android</li>\n</ul>\n<h3>Side-projects</h3>\n<h4>소프트웨어에 물들다 사이트 개발 2018.03-05</h4>\n<ul>\n<li>자원봉사 프로젝트 팀 소프트웨어에 물들다(<a href="http://somul.kr">http://somul.kr</a>)에서 개발참여</li>\n<li>자원봉사자들의 참가신청을 도와주는 도서관, 강연자 매칭 시스템 개발(<a href="http://apply.somul.kr/">http://apply.somul.kr/</a>)</li>\n<li>Back-end 참여, Python/Flask 활용하여 구현</li>\n<li>CI pipeline 구축</li>\n<li>GitHub <a href="https://github.com/somul-project/somul-apply-library">https://github.com/somul-project/somul-apply-library</a> </li>\n</ul>\n<h3>Awards</h3>\n<h4>제 3회 소프트웨어 중심대학 오픈소스 해커톤 정보통신부 장관상 - 한국정보과학회 2018.06</h4>\n<ul>\n<li>블로그에 정리하기 부담스러운 토막지식 원클릭으로 입력하는 “TILUP” 개발</li>\n<li>2박3일 해커톤</li>\n<li>Front-end 참여, React/Nodejs 활용하여 구현</li>\n<li>Back-end 참여, Express/Nodejs 활용하여 구현</li>\n<li>CI/CD Pipeline 구현</li>\n<li>GitHub <a href="https://github.com/OrangeTen/TodayILearned">https://github.com/OrangeTen/TodayILearned</a></li>\n</ul>\n<h4>학부 50주년 작품 전시회 최우수상 - 고려대학교 공과대학 2017.11</h4>\n<ul>\n<li>유저가 찍은 사진을 화가가 그린 그림처럼 화풍을 변환해주는 어플리케이션 “stylized-camera” 개발</li>\n<li>Android Application PlayStore 배포(Java / Android)</li>\n<li>실시간으로 스타일 변환 결과를 돌려주는 Worker 구현(Python / Tensorflow)</li>\n<li>Dockerize</li>\n<li>\n<p>딥러닝 fast-style-transfer논문기반 구현</p>\n<ul>\n<li><a href="https://arxiv.org/pdf/1603.08155v1.pdf">Perceptual Losses for Real-Time Style Transfer and Super-Resolution</a></li>\n<li><a href="%E2%80%8B%E2%80%8Bhttps://arxiv.org/pdf/1508.06576.pdf">A Neural Algorithm of Artistic Style</a></li>\n</ul>\n</li>\n<li>\n<p>GitHub</p>\n<ul>\n<li><a href="https://github.com/kujyp/stylized-camera-android">https://github.com/kujyp/stylized-camera-android</a></li>\n<li><a href="https://github.com/kujyp/stylized-camera-worker">https://github.com/kujyp/stylized-camera-worker</a></li>\n</ul>\n</li>\n</ul>\n<h4>제 18회 KU Campus &#x26; RnD CEO 경진대회 우수상 - 고려대학교 산학협력단 2017.06</h4>\n<ul>\n<li>농부들의 문자로 처리하는 택배 주문방식을 자동화시켜주는 Chatbot “우렁각시” 개발</li>\n<li>Java / Android, Firebase Realtime Database 활용</li>\n<li>Slot-filling 방식으로 Chatbot 구현.</li>\n<li>GitHub <a href="https://github.com/BitenPeach/BitenPeach_android">https://github.com/BitenPeach/BitenPeach_android</a></li>\n</ul>\n<h4>제 1회 창업경진대회 대상 - 서울시 고려대 안암동 캠퍼스타운 지원센터 2017.11</h4>\n<ul>\n<li>스타트업 smArts팀으로 수상</li>\n<li>Smart Home Device를 스마트폰으로 제어하는 어플리케이션 “jibcon” 개발</li>\n<li>홍보영상 <a href="https://www.youtube.com/watch?v=yPMhvbhYeGM">https://www.youtube.com/watch?v=yPMhvbhYeGM</a></li>\n</ul>\n<h4>소프트웨어 중심대학 오픈소스 해커톤 우수상 - 한국정보과학회 오픈소스소프트웨어 연구회 2017.02</h4>\n<ul>\n<li>부동산거래 중계 플랫폼 직방, 다방과 유사한 VR로 방을 구경할 수 있는 웹 플랫폼 “돌려방” 개발</li>\n<li>2박3일 해커톤</li>\n<li>Python / Django, Javascript / Aframe 활용</li>\n<li>결과사이트 <a href="http://sigoss.github.io/hackathon2017/index.html">http://sigoss.github.io/hackathon2017/index.html</a></li>\n<li>GitHub <a href="https://github.com/hskang9/WebVR">https://github.com/hskang9/WebVR</a> </li>\n</ul>\n<h4>제 1회 모의크라우드펀딩 경진대회 장려상 - 미래창조과학부 2016.12</h4>\n<ul>\n<li>강의를 녹음 후 내용을 받아적어주는 솔루션 “음성인식강의록” 개발</li>\n<li>Java / Android 활용</li>\n<li>홍보영상제작 <a href="https://www.youtube.com/watch?v=Obtevs1JTgM">https://www.youtube.com/watch?v=Obtevs1JTgM</a> </li>\n</ul>',frontmatter:{title:"About me",date:null,description:null}}},pathContext:{slug:"/about"}}}});
